import { useEffect } from 'react'
import {
  IAuthInfo,
  IBroadInfo,
  IPlayerInfo,
} from '../interface/commonInterface'
import { useNavigate } from 'react-router-dom'

export default function Home() {
  const navigate = useNavigate()
  useEffect(() => {

    extensionSDK.handleAuthorized(
      (userInfo: IAuthInfo, broadInfo: IBroadInfo, playerInfo: IPlayerInfo) => {
        console.log('userInfo: ', userInfo)
      }
    )
  }, [])

  return (
    <div className="Home">
      <div className="addBtn" onClick={() => navigate('/new')}>
        <span>+</span>
      </div>
    </div>
  )
}
